import React from "react";
import {
  FiGithub,
  FiLinkedin,
} from "react-icons/fi";
import { FaReact } from 'react-icons/fa';

const skillsContent = [
  {
    name: "React.Js",
    iconName: <FaReact style={{}}/>,

  },
  {
    name: "Vue.Js",
    iconName: <FiGithub />,
  },
  {
    name: "Photoshop",
    iconName: <FiGithub />,
  },
  {
    name: "Figma",
    iconName: <FiGithub />,
  },
  {
    name: "Illustrator",
    iconName: <FiGithub />,
  },
  {
    name: "WordPress",
    iconName: <FiGithub />,
  },
];

const Skills = () => {
  return (
    <>
      {skillsContent.map((val, i) => (
        <div className="progress_inner" key={i}>
          <span className="label">{val.name}</span>
          <div>
            {val.iconName}
          </div>
        </div>
      ))}
    </>
  );
};

export default Skills;
